import React from 'react';
import PropTypes from 'prop-types';


const Section = (props) => {
  return(
    //<AboutUs />
    <section className="container-fluid">
      <div className="row">
        <props.component />
      </div>
    </section>
  );
}

Section.propTypes = {
  component: PropTypes.node.isRequired
}


export default Section;
